import React, { Component, useEffect } from 'react';
import { initContract, login, logout } from '../utils';

const HomePage = () => {

  useEffect(() => {
    window.nearInitPromise = initContract();
  })

  return (
		<div>
			<h1>Hola Mundo</h1>
      <button onClick={login}>Login</button>
		</div>
	);
}

export default HomePage;
